   ), // with mainnet RPC
   network: 'mainnet-beta',
});

const allMainnetVolts: VoltSDK[] = await friktionSdk.getAllVoltsInSnapshot();

friktionSdk = new FriktionSDK({
   provider: new AnchorProvider(
     new Connection("https://api.devnet.solana.com"),
