Full Example
import {
  FriktionSDK,
  PendingWithdrawal,
  toConnectedSDK,
} from "@friktion-labs/friktion-sdk";
import { AnchorProvider, Wallet } from "@friktion-labs/anchor";
import {
  createAssociatedTokenAccountInstruction,
  getAccount,
  getAssociatedTokenAddress,
} from "@solana/spl-token";
import type { TransactionInstruction } from "@solana/web3.js";
import { Connection, PublicKey, Transaction } from "@solana/web3.js";
import Decimal from "decimal.js";

// SOL Covered Call Volt
const voltVaultId = new PublicKey(
  "CbPemKEEe7Y7YgBmYtFaZiECrVTP5sGrYzrrrviSewKY"
);
const PROVIDER_URL = "https://api.mainnet-beta.solana.com";
const CLUSTER = "mainnet-beta";

const provider = new AnchorProvider(
  new Connection(PROVIDER_URL),
  Wallet.local(),
  {}
);
const connection = provider.connection;

const friktionSDK: FriktionSDK = new FriktionSDK({
  provider: provider,
  network: CLUSTER,
});

const user = provider.wallet.publicKey;

const withdrawAmount: Decimal = new Decimal(0.00001);

(async () => {
  const cVoltSDK = toConnectedSDK(
    await friktionSDK.loadVoltSDKByKey(voltVaultId),
    connection,
    user,
    // below field is only used if depositing from a PDA or other program-owned account
    undefined
  );

  const payer = cVoltSDK.wallet;
  const authority = cVoltSDK.daoAuthority
    ? cVoltSDK.daoAuthority
    : cVoltSDK.wallet;

  const voltVault = cVoltSDK.voltVault;
  const depositMint = voltVault.depositMint;
  const vaultMint = voltVault.vaultMint;

  const withdrawalInstructions: TransactionInstruction[] = [];

  const depositTokenAccountKey: PublicKey = await getAssociatedTokenAddress(
    depositMint,
    authority
  );
  const vaultTokenAccountKey: PublicKey = await getAssociatedTokenAddress(
    vaultMint,
    authority
  );

  try {
    // try to get account info
    await getAccount(connection, depositTokenAccountKey);
  } catch (err) {
    withdrawalInstructions.push(
      createAssociatedTokenAccountInstruction(
        payer,
        depositTokenAccountKey,
        authority,
        depositMint
      )
    );
  }

  // NOTE: Shouldn't be necessary since user must have created to receive volt tokens if now withdrawing
  try {
    await getAccount(connection, vaultTokenAccountKey);
  } catch (err) {
    withdrawalInstructions.push(
      createAssociatedTokenAccountInstruction(
        payer,
        vaultTokenAccountKey,
        authority,
        vaultMint
      )
    );
  }

  // if instant transfers aren't currently possible, need to handle already existing pending withdrawals
  if (!voltVault.instantTransfersEnabled) {
    let pendingWithdrawalInfo: PendingWithdrawal | undefined;
    try {
      pendingWithdrawalInfo = await cVoltSDK.getPendingWithdrawalForGivenUser(
        authority
      );
    } catch (err) {
      pendingWithdrawalInfo = undefined;
    }

    // if a pending withdrawal exists, need to handle it
    if (
      pendingWithdrawalInfo &&
      pendingWithdrawalInfo?.numVoltRedeemed?.gtn(0) &&
      pendingWithdrawalInfo.roundNumber?.gtn(0)
    ) {
      // if is claimable, then claim it first
      if (pendingWithdrawalInfo.roundNumber.lt(voltVault.roundNumber)) {
        withdrawalInstructions.push(
          await cVoltSDK.claimPendingWithdrawal(depositTokenAccountKey)
        );
      }
      // else, cancel the withdrawal or throw an error
      else {
        withdrawalInstructions.push(
          await cVoltSDK.cancelPendingWithdrawal(vaultTokenAccountKey)
        );
        // if don't want to override existing withdrawal, can throw error instead
        // throw new Error("pending withdrawal already exists")
      }
    }
  }

  withdrawalInstructions.push(
    await cVoltSDK.withdrawHumanAmount(
      withdrawAmount,
      vaultTokenAccountKey,
      depositTokenAccountKey,
      authority
    )
  );

  const transaction = new Transaction();

  for (const ix of withdrawalInstructions) {
    transaction.add(ix);
  }

  console.log("sending transaction...");
  const txResult = await provider.sendAndConfirm(transaction);
  console.log("tx result = ", txResult);
})();

integration/typescript-sdk/load-balances.body:
Load Balances
Loading user balances is vital to understand a user's position in a Friktion volt. This is made non-trivial by the pending deposit/withdrawal epoch system Friktion employs. The following example demonstrates how to understand the balances returned by our SDK
Code
import { FriktionSDK, VoltSDK } from "@friktion-labs/friktion-sdk";
import { AnchorProvider, Wallet } from "@project-serum/anchor";
import { Connection, PublicKey } from "@solana/web3.js";

// SOL Covered Call Volt
const voltVaultId = new PublicKey(
  "CbPemKEEe7Y7YgBmYtFaZiECrVTP5sGrYzrrrviSewKY"
);
const PROVIDER_URL = "https://api.mainnet-beta.solana.com";
const CLUSTER = "mainnet-beta";
const provider = new AnchorProvider(
  new Connection(PROVIDER_URL),
  Wallet.local(),
  {}
);
const friktionSDK: FriktionSDK = new FriktionSDK({
  provider: provider,
  network: CLUSTER,
});
const user = provider.wallet.publicKey;

(async () => {
  const voltSdk: VoltSDK = await friktionSDK.loadVoltSDKByKey(voltVaultId);
  console.log(
    "balances for wallet = ",
    user.toString(),
    "\n",
    await voltSdk.getBalancesForUser(user)
  );
})();

Example
User flow followed by the diff in output of getBalancesForuser()  at every step.  
1. Epoch Begins
User starts epoch with 15 volt tokens in wallet. They made one claimable pending deposit in the previous epoch for 0.1 SOL. No pending withdrawals. There are 100 volt tokens in circulation and 1 SOL inside the volt. Thus, each volt token is worth 0.01 SOL, 5 volt tokens = 0.05 SOL, 10 volt tokens = 0.1 SOL.
{
  totalBalance: 0.25, // total # SOL user has in Friktion (e.g 0.001 SOL)
  normalBalance: 0.15, // SOL value of volt tokens in user's wallet
  pendingDeposits: 0.1, // SOL value of users's unclaimed and pending deposits
  pendingWithdrawals: 0.0, // SOL value of user's unclaimed and pending withdrawals
  mintableShares: 0.1, // # of volt tokens user could mint immediately. from the claimable deposit
  claimableUnderlying: 0.0, // SOL value of user's *mintableShares*
  normFactor: 1000000000, // 10^(number of decimals in SOL mint) = 10^9 for SOL, varies depending on deposit token
  vaultNormFactor: 1000000000 // generally equivalent to normFactor, but may differ if deposit token was migrated (e.g sollet deprecation)
}

2. Initiates Pending Withdrawal
User burns 5 volt tokens to create a pending withdrawal. There are now 95 volt tokens in circulation
